import axios from 'axios';
export const signin=(data)=>
{
    axios.post(`http://localhost:5001/api/users/signin`,{data})
      .then(res => {
          return res;
      })
}
export const login=(data)=>
{
    axios.post(`http://localhost:5001/api/users/login`,{data})
      .then(res => {
          console.log()
          return res;
      })
}
